INSERT INTO `contenido` (`id`, `nombre`, `texto`, `usuario_id`) VALUES
(43, 'CONTROL DE ACCESO INTERNO', '<p><strong>CONTRASE&Ntilde;A</strong> Una contrase&ntilde;a o clave es una forma de autentificaci&oacute;n que utiliza informaci&oacute;n secreta para controlar el acceso hacia alg&uacute;n recurso. La contrase&ntilde;a debe mantenerse en secreto ante aquellos a quien no se les permite el acceso. La seguridad de un sistema protegido por contrase&ntilde;a depende de varios factores. El sistema debe estar dise&ntilde;ado para sondear la seguridad. Algunos problemas sobre la administraci&oacute;n de contrase&ntilde;as que deben ser considerados: -Posibilidad de que alg&uacute;n atacante pueda adivinar o inventar la contrase&ntilde;a. -Formas de almacenar contrase&ntilde;as. -M&eacute;todo de retransmisi&oacute;n de la contrase&ntilde;a al usuario. -Longevidad de una contrase&ntilde;a. -N&uacute;mero de usuarios por cada contrase&ntilde;a. ENCRIPTACION Tradicionalmente se ha definido como el &aacute;mbito de la criptolog&iacute;a el que se ocupa de las t&eacute;cnicas de cifrado o codificado destinadas a alterar las representaciones ling&uuml;&iacute;sticas de ciertos mensajes con el fin de hacerlos ininteligibles a receptores no autorizados. Las transacciones que se realizan a trav&eacute;s de la red pueden ser interceptadas, y por tanto, la seguridad de esta informaci&oacute;n debe garantizarse. Este desaf&iacute;o ha generalizado los objetivos de la criptograf&iacute;a para ser la parte de la criptolog&iacute;a que se encarga del estudio de los algoritmos, protocolos, y sistemas que se utilizan para proteger la informaci&oacute;n y dotar de seguridad a las comunicaciones y a las entidades que se comunican. La criptograf&iacute;a actualmente se encarga del estudio de los algoritmos, protocolos y sistemas que se utilizan para dotar de seguridad a las comunicaciones, a la informaci&oacute;n y a las entidades que se comunican. Por tanto el tipo de propiedades de las que se ocupa la criptograf&iacute;a son, por ejemplo: -Confidencialidad. Es decir, garantiza que la informaci&oacute;n sea accesible &uacute;nicamente a personal autorizado. Para conseguirlo utiliza c&oacute;digos y t&eacute;cnicas de cifrado. -Integridad. Es decir garantiza la correcci&oacute;n y completitud de la informaci&oacute;n. Para conseguirlo puede usar por ejemplo funciones hash criptogr&aacute;ficas MDC, protocolos de compromiso de bit, o protocolos de notarizaci&oacute;n electr&oacute;nica. -Vinculaci&oacute;n. Permite vincular un documento o transacci&oacute;n a una persona o un sistema de gesti&oacute;n criptogr&aacute;fico automatizado. -Autenticaci&oacute;n. Es decir proporciona mecanismos que permiten verificar la identidad del comunicador. LISTAS DE CONTROL DE ACCESO Las ACL permiten controlar el flujo del tr&aacute;fico en equipos de redes, tales como enrutadores y conmutadores. Su principal objetivo es filtrar tr&aacute;fico, permitiendo o denegando el tr&aacute;fico de red de acuerdo a alguna condici&oacute;n. Se asemejar&iacute;a a un sistema de control de accesos f&iacute;sico t&iacute;pico de un edificio, donde esa parte est&aacute; centralizada en un lugar. Este lugar solo necesita saber dos cosas: Quien eres (por ejemplo un ID de una tarjeta, tu id de usuario) y que quieres hacer. El te responde si tienes permiso de hacerlo o no. Con este enfoque este mismo sistema no solo puede ser utilizado para acceder a lugares si no para cualquier cosa que necesite separarse de personas que pueden y no pueden hacer cosas, por ejemplo: acceder a una p&aacute;gina o secci&oacute;n, publicar un comentario, hacer una amistad, enviar un correo. En redes inform&aacute;ticas, ACL se refiere a una lista de reglas que detallan puertos de servicio o nombres de dominios (de redes) que est&aacute;n disponibles en un terminal u otro dispositivo de capa de red, cada uno de ellos con una lista de terminales y/o redes que tienen permiso para usar el servicio. Tanto servidores individuales como enrutadores pueden tener ACL de redes. Las listas de control de acceso pueden configurarse generalmente para controlar tr&aacute;fico entrante y saliente y en este contexto son similares a un cortafuegos. Las ACL permiten un control del tr&aacute;fico de red, a nivel de los routers. Pueden ser parte de una soluci&oacute;n de seguridad (junton con otros componentes, como antivirus, firewall, proxy, etc.). - Una ACL es una lista de una o m&aacute;s instrucciones. - Se asigna una lista a una o m&aacute;s interfaces. - Cada instrucci&oacute;n permite o rechaza tr&aacute;fico, usando uno o m&aacute;s de los siguientes criterios: el origen del tr&aacute;fico; el destino del tr&aacute;fico; el protocolo usado. CENTRO DE DISTRIBUCI&Oacute;N DE CLAVES (KDC, KEY DISTRIBUTION CENTRE) Se basa en el uso de claves jer&aacute;rquicas, a fin de que la comunicaci&oacute;n entre un par de interlocutores se d&eacute; a trav&eacute;s de una clave de sesi&oacute;n. Dichas claves de sesi&oacute;n deben ser acordadas a trav&eacute;s del KDC y protegidas con una clave de jerarqu&iacute;a superior que es compartida por el KDC y el sistema o entidad interlocutora. Los tres pasos que intervienen en la distribuci&oacute;n son: 1. Una entidad A desea comunicarse con una entidad B. A env&iacute;a una solicitud de clave de sesi&oacute;n al KDC. La solicitud incluye la identidad de A, la identidad de B y un n&uacute;mero de sesi&oacute;n. 2. El KDC responde a la entidad A con un mensaje cifrado con la clave maestra de A (que solo A y el KDC conocen). El mensaje consta de: 1) la clave de sesi&oacute;n, 2) la solicitud inicial de A, y 3) un paquete cifrado con la clave maestra de B. 3. A env&iacute;a el paquete a B, quien lo descifra y encontrar&aacute; la clave de sesi&oacute;n junto con la identidad de A. En este momento A y B pueden comenzar la comunicaci&oacute;n a trav&eacute;s de un canal inseguro. TARJETAS INTELIGENTES Una tarjeta inteligente (smart card), o tarjeta con circuito integrado (TCI), es cualquier tarjeta del tama&ntilde;o del bolsillo con circuitos integrados, que permite la ejecuci&oacute;n de cierta l&oacute;gica programada. Aunque existe un diverso rango de aplicaciones, hay dos categor&iacute;as principales de TCI. Las tarjetas de memoria contienen s&oacute;lo componentes de memoria no vol&aacute;til y posiblemente alguna l&oacute;gica de seguridad. Las tarjetas microprocesadoras contienen memoria y microprocesadores. Las tarjetas no contienen bater&iacute;as; la energ&iacute;a es suministrada por los lectores de tarjetas. FIRMA DIGITAL Una firma digital es un mecanismo criptogr&aacute;fico que permite al receptor de un mensaje firmado digitalmente determinar la entidad originadora de dicho mensaje, y confirmar que el mensaje no ha sido alterado desde que fue firmado por el originador. La firma digital se aplica en documentos electr&oacute;nicos o software, ya que proporciona una herramienta para detectar la falsificaci&oacute;n y la manipulaci&oacute;n del contenido. Propiedades necesarias Para garantizar la seguridad de las firmas digitales es necesario a su vez que estas sean: -&Uacute;nicas: Las firmas deben poder ser generadas solamente por el firmante y por lo tanto infalsificable. Por tanto la firma debe depender del firmante -Infalsificables: Para falsificar una firma digital el atacante tiene que resolver problemas matem&aacute;ticos de una complejidad muy elevada, es decir, las firmas han de ser computacionalmente seguras. Por tanto la firma debe depender del mensaje en s&iacute;. -Verificables: Las firmas deben ser f&aacute;cilmente verificables por los receptores de las mismas y, si ello es necesario, tambi&eacute;n por los jueces o autoridades competentes. -Innegables: El firmante no debe ser capaz de negar su propia firma. -Viables: Las firmas han de ser f&aacute;ciles de generar por parte del firmante. CERTIFICADO DIGITAL Un certificado digital o certificado electr&oacute;nico es un fichero inform&aacute;tico generado por una entidad de servicios de certificaci&oacute;n que asocia unos datos de identidad a una persona f&iacute;sica, organismo o empresa confirmando de esta manera su identidad digital en Internet. El certificado digital es v&aacute;lido principalmente para autenticar a un usuario o sitio web en internet por lo que es necesaria la colaboraci&oacute;n de un tercero que sea de confianza para cualquiera de las partes que participe en la comunicaci&oacute;n. Uso del certificado -Autenticar la identidad del usuario, de forma electr&oacute;nica, ante terceros. -Firmar electr&oacute;nicamente de forma que se garantice la integridad de los datos trasmitidos y su procedencia. Un documento firmado no puede ser manipulado, ya que la firma est&aacute; asociada matem&aacute;ticamente tanto al documento como al firmante -Cifrar datos para que s&oacute;lo el destinatario del documento pueda acceder a su contenido.</p>', 24),
(47, 'INVESTIGACIÓN OPERATIVA', '<p>Investigaci&oacute;n de Operaciones INTRODUCCI&Oacute;N A LA INVESTIGACI&Oacute;N DE OPERACIONES (I de O) Actualmente la administraci&oacute;n est&aacute; funcionando en un ambiente de negocios que est&aacute; sometido a muchos m&aacute;s cambios, los ciclos de vida de los productos se hacen m&aacute;s cortos, adem&aacute;s de la nueva tecnolog&iacute;a y la internacionalizaci&oacute;n creciente.</p>\n<p><strong>INVESTIGACI&Oacute;N DE OPERACIONES (I .O) </strong></p>\n<p>Las ra&iacute;ces de la investigaci&oacute;n de operaciones se remonta a los tiempos cuando se hicieron los primeros intentos para emplear el m&eacute;todo cient&iacute;fico en la administraci&oacute;n de una empresa. Sin embargo, el inicio de esta disciplina se atribuye a los servicios militares prestados a principios de la segunda guerra mundial. La I.O tiene sus or&iacute;genes en la segunda guerra mundial , debido a la necesidad urgente de asignaci&oacute;n de recursos escasos en la operaciones militares en problemas t&aacute;cticos y estrat&eacute;gicos. Estas mismas t&eacute;cnicas se han extendido con posterioridad a las empresas.</p>\n<p><strong>NATURALEZA DE LA INVESTIGACION DE OPERACIONES </strong></p>\n<p>La investigaci&oacute;n de operaciones se aplica a problemas que se refieren a la conducci&oacute;n y coordinaci&oacute;n de operaciones (o actividades) dentro de una organizaci&oacute;n. La investigaci&oacute;n de operaciones intenta encontrar una mejor soluci&oacute;n, (llamada soluci&oacute;n &oacute;ptima) para el problema bajo consideraci&oacute;n.</p>\n<p><strong>EL GRUPO INTERDISCIPLINARIO</strong></p>\n<p>Una de las principales razones de la existencia de grupos de investigaci&oacute;n de operaciones es que la mayor parte de los problemas de negocios tienen m&uacute;ltiples aspectos: es perfectamente razonable que las fases individuales de un problema se comprendan y analicen mejor por los que tienen el adiestramiento necesario en los campos apropiados. La investigaci&oacute;n de operaciones es la aplicaci&oacute;n, por grupos interdisciplinarios, del m&eacute;todo cient&iacute;fico a problemas relacionados con el control de las organizaciones o sistemas, a fin de que se produzcan soluciones que mejor sirvan a los objetivos de la organizaci&oacute;n.</p>\n<p><strong>&iquest;QU&Eacute; ES LA INVESTIGACI&Oacute;N DE OPERACIONES? &iquest;QU&Eacute; ES LA INVESTIGACI&Oacute;N DE OPERACIONES? </strong></p>\n<p>La I.O se puede definir como la aplicaci&oacute;n de m&eacute;todos cient&iacute;ficos en la mejora de la efectividad en las operaciones, decisiones y gesti&oacute;n o como la ciencia de aplicar los recursos disponibles para conseguir la satisfacci&oacute;n &oacute;ptima de un objetivo espec&iacute;fico deseado. Definici&oacute;n: Un enfoque cient&iacute;fico para la toma de decisiones ejecutivas, que consiste en: a) el arte de modelar situaciones complejas, b) la ciencia de desarrollar t&eacute;cnicas de soluci&oacute;n para resolver dichos modelos c) la capacidad de comunicar efectivamente los resultados. Aspectos a rescatar de la definici&oacute;n:</p>\n<ul>\n<li>Una organizaci&oacute;n es un sistema formado por componentes que se interaccionan, unas de estas interacciones pueden ser controladas y otras no.</li>\n<li>La complejidad de los problemas que se presentan en las organizaciones ya no encajan en una sola disciplina del conocimiento, se han convertido en multidisciplinario por lo cual para su an&aacute;lisis y soluci&oacute;n se requieren grupos compuestos por especialistas de diferentes &aacute;reas del conocimiento que logran comunicarse con un lenguaje com&uacute;n.</li>\n<li>La investigaci&oacute;n de operaciones es la aplicaci&oacute;n de la metodolog&iacute;a cient&iacute;fica a trav&eacute;s de modelos matem&aacute;ticos, primero para representar al problema y luego para resolverlo. Aspectos a rescatar de la definici&oacute;n: La principal caracter&iacute;stica consiste en construir un modelo cient&iacute;fico del problema del cual se puedan predecir y comparar los resultados de diversas estrategias y decisiones incorporando medidas del azar y del riesgo. El objetivo es ayudar a los responsables a determinar su pol&iacute;tica y actuaciones en forma cient&iacute;fica. Un modelo matem&aacute;tico es una descripci&oacute;n matem&aacute;tica (con frecuencia mediante una funci&oacute;n o una ecuaci&oacute;n), de un fen&oacute;meno del mundo real, como por ejemplo el tama&ntilde;o de una poblaci&oacute;n, la demanda por un producto, la rapidez de ca&iacute;da de un objeto, la concentraci&oacute;n de un producto en una reacci&oacute;n qu&iacute;mica, la expectativa de vida de una persona cuando nace o el costo de la reducci&oacute;n de emisiones. El prop&oacute;sito del modelo es entender el fen&oacute;meno y quiz&aacute; hacer predicciones con respecto al comportamiento futuro.</li>\n</ul>\n<p><strong>ENFOQUE DE LA INVESTIGACI&Oacute;N DE OPERACIONES SOLUCI&Oacute;N AL PROBLEMA DEL SISTEMA REAL SISTEMA REAL SOLUCI&Oacute;N AL MODELO MODELO CUANTITATIVO SISTEMA ASUMIDO JUICIOS Y EXPERIENCIAS VARIABLES RELEVANTES RELACIONES RELEVANTES M&Eacute;TODO DE SOLUCI&Oacute;N INTERPRETACI&Oacute;N DECISIONES METODOLOG&Iacute;A DE LA I de O </strong></p>\n<ol>\n<li>Definici&oacute;n del problema Esto incluye determinar los objetivos apropiados, las restricciones sobre lo que se puede hacer, las interrelaciones del &aacute;rea bajo estudio con otras &aacute;reas de la organizaci&oacute;n, los diferentes cursos de acci&oacute;n posibles, los l&iacute;mites de tiempo para tomar una decisi&oacute;n, etc. Este proceso de definir el problema es crucial ya que afectar&aacute; en forma significativa la relevancia de las conclusiones del estudio.</li>\n<li>Formulaci&oacute;n de un modelo matem&aacute;tico La forma convencional en que la investigaci&oacute;n de operaciones realiza esto es construyendo un modelo matem&aacute;tico que represente la esencia del problema. Un modelo siempre debe ser menos complejo que el problema real, es una proximaci&oacute;n abstracta de la realidad con consideraciones y simplificaciones que hacen m&aacute;s manejable el problema y permiten evaluar eficientemente las alternativas de soluci&oacute;n.</li>\n<li>Obtenci&oacute;n de una soluci&oacute;n a partir del modelo. Resolver un modelo consiste en encontrar los valores de las variables dependientes, asociadas a las componentes controlables del sistema con el prop&oacute;sito de optimizar, si es posible, o cuando menos mejorar la eficiencia o la efectividad del sistema dentro del marco de referencia que fijan los objetivos y las restricciones del problema.</li>\n</ol>\n<p>La selecci&oacute;n del m&eacute;todo de soluci&oacute;n depende de las caracter&iacute;sticas del modelo. Los procedimientos de soluci&oacute;n pueden ser clasificados en tres tipos: a) anal&iacute;ticos, que utilizan procesos de deducci&oacute;n matem&aacute;tica; b) num&eacute;ricos, que son de car&aacute;cter inductivo y funcionan en base a operaciones de prueba y error; c) simulaci&oacute;n, que utiliza m&eacute;todos que imitan o, emulan al sistema real, en base a un modelo. 4. Prueba del modelo Antes de usar el modelo debe probarse exhaustivamente para intentar identificar y corregir todas las fallas que se puedan presentar 5. Validaci&oacute;n del modelo Es importante que todas las expresiones matem&aacute;ticas sean consistentes en las dimensiones de las unidades que emplean. Adem&aacute;s, puede obtenerse un mejor conocimiento de la validez del modelo variando los valores de los par&aacute;metros de entrada y/o de las variables de decisi&oacute;n, y comprobando que los 6. Establecimiento de controles sobre la soluci&oacute;n Esta fase consiste en determinar los rangos de variaci&oacute;n de los par&aacute;metros dentro de los cuales no cambia la soluci&oacute;n del problema. Es necesario generar informaci&oacute;n adicional sobre el comportamiento de la soluci&oacute;n debido a cambios en los par&aacute;metros del modelo. Usualmente esto se conoce como AN&Aacute;LISIS DE SENSIBILIDAD. 7. Implantaci&oacute;n de la soluci&oacute;n El paso final se inicia con el proceso de "vender" los hallazgos que se hicieron a lo largo del proceso a los ejecutivos o tomadores de decisiones. NORMAS PARA LOGRAR &Eacute;XITO EN LA I de O 1. El &eacute;xito del empleo de la I de O es el de un enfoque de soluci&oacute;n de problemas y no una colecci&oacute;n asociada de m&eacute;todos cuantitativos. 2. La I de O es relativamente costosa, lo que significa que no debe emplearse en todos los problemas, sino tan s&oacute;lo en aquellos en que las ganancias sea mayores que los costos. &bull; Para llegar a hacer un uso apropiado de la I de O, es necesario primero comprender la metodolog&iacute;a para resolver los problemas, as&iacute; como los fundamentos de las t&eacute;cnicas de soluci&oacute;n para de esta forma saber cu&aacute;ndo utilizarlas o no en las diferentes circunstancias. NORMAS......... . Disciplinas t&iacute;picas dentro de la I. O son: la optimizaci&oacute;n, con sus m&uacute;ltiples &aacute;reas (Programaci&oacute;n lineal, no lineal, entera, estoc&aacute;stica). La teor&iacute;a de decisiones y juegos, teor&iacute;a de grafos o flujos de redes y simulaci&oacute;n.</p>', 24),
(49, 'facebook', NULL, 26),
(50, 'LA MATERIA', '<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: center;"><strong>LA MATERIA</strong></p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><strong>MATERIA</strong></p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;">E<span style="text-decoration: underline;">s todo aquello que ocupa un lugar en el espacio, posee una cierta cantidad de&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="Energ&iacute;a" href="https://es.wikipedia.org/wiki/Energ%C3%ADa">energ&iacute;a</a>, y est&aacute; sujeto a&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="Ecuaci&oacute;n de movimiento" href="https://es.wikipedia.org/wiki/Ecuaci%C3%B3n_de_movimiento">cambios en el tiempo</a>&nbsp;y a interacciones con aparatos de medida.</span> Se considera que es lo que forma la parte sensible de los objetos perceptibles o detectables por medios f&iacute;sicos.</p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><span style="text-decoration: underline;">Etimol&oacute;gicamente, proviene del&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="Lat&iacute;n" href="https://es.wikipedia.org/wiki/Lat%C3%ADn">lat&iacute;n</a>&nbsp;materia,&nbsp;que significa &laquo;sustancia de la que est&aacute;n hechas las cosas&raquo;</span> y que tambi&eacute;n alude a la &laquo;<a style="text-decoration: none; color: #0b0080; background: none;" title="Madera" href="https://es.wikipedia.org/wiki/Madera">madera</a>&nbsp;dura del interior de un &aacute;rbol&raquo;;<sup id="cite_ref-Corominas_DCE_1-0" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/Materia#cite_note-Corominas_DCE-1">1</a></sup>&nbsp;la palabra est&aacute; relacionada con&nbsp;<em>m?ter</em>&nbsp;(&laquo;origen, fuente,&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Madre" href="https://es.wikipedia.org/wiki/Madre">madre</a>&raquo;)<sup id="cite_ref-OED_2-0" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/Materia#cite_note-OED-2">2</a></sup>&nbsp;y se corresponde con el&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Idioma griego" href="https://es.wikipedia.org/wiki/Idioma_griego">griego</a>&nbsp;<em>hyle</em><sup id="cite_ref-3" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/Materia#cite_note-3">3</a></sup>&nbsp;(de&nbsp;<em>hylos</em>: &laquo;bosque, madera, le&ntilde;a, material&raquo;)<sup id="cite_ref-OED2_4-0" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/Materia#cite_note-OED2-4">4</a></sup>&nbsp;<sup id="cite_ref-Ernout.26Meillet_1951_5-0" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/Materia#cite_note-Ernout.26Meillet_1951-5">5</a></sup>&nbsp;que es un concepto&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Arist&oacute;teles" href="https://es.wikipedia.org/wiki/Arist%C3%B3teles">aristot&eacute;lico</a>&nbsp;de la teor&iacute;a filos&oacute;fica del&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Hilemorfismo" href="https://es.wikipedia.org/wiki/Hilemorfismo">hilemorfismo</a>.<sup id="cite_ref-6" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/Materia#cite_note-6">6</a></sup></p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><strong>ATOMO</strong>&nbsp;</p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><span style="text-decoration: underline;">Es la unidad constituyente m&aacute;s peque&ntilde;a de la&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="Materia" href="https://es.wikipedia.org/wiki/Materia">materia</a>&nbsp;que tiene las propiedades de un&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="Elemento qu&iacute;mico" href="https://es.wikipedia.org/wiki/Elemento_qu%C3%ADmico">elemento qu&iacute;mico</a></span>.<sup id="cite_ref-1" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/%C3%81tomo#cite_note-1">1</a></sup>&nbsp;Cada&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="S&oacute;lido" href="https://es.wikipedia.org/wiki/S%C3%B3lido">s&oacute;lido</a>,&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="L&iacute;quido" href="https://es.wikipedia.org/wiki/L%C3%ADquido">l&iacute;quido</a>,&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Gas" href="https://es.wikipedia.org/wiki/Gas">gas</a>&nbsp;y&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Plasma (estado de la materia)" href="https://es.wikipedia.org/wiki/Plasma_(estado_de_la_materia)">plasma</a>&nbsp;se compone de &aacute;tomos neutros o&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Ionizaci&oacute;n" href="https://es.wikipedia.org/wiki/Ionizaci%C3%B3n">ionizados</a>. <span style="text-decoration: underline;">Los &aacute;tomos son muy peque&ntilde;os; los tama&ntilde;os t&iacute;picos son alrededor de 100&nbsp;pm</span> (diez mil millon&eacute;sima parte de un metro).<sup id="cite_ref-Ghosh02_2-0" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/%C3%81tomo#cite_note-Ghosh02-2">2</a></sup>&nbsp;No obstante, los &aacute;tomos no tienen l&iacute;mites bien definidos y hay diferentes formas de definir su tama&ntilde;o que dan valores diferentes pero cercanos. Los &aacute;tomos son lo suficientemente peque&ntilde;os para que la f&iacute;sica cl&aacute;sica d&eacute; resultados notablemente incorrectos. A trav&eacute;s del desarrollo de la f&iacute;sica, los modelos at&oacute;micos han incorporado principios cu&aacute;nticos para explicar y predecir mejor su comportamiento.</p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><strong>NUCLEO ATOMICO</strong></p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><span style="text-decoration: underline;">Es la parte central de un&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="&Aacute;tomo" href="https://es.wikipedia.org/wiki/%C3%81tomo">&aacute;tomo</a>, tiene&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="Carga el&eacute;ctrica" href="https://es.wikipedia.org/wiki/Carga_el%C3%A9ctrica">carga positiva</a>, y concentra m&aacute;s del 99,9% de la masa total del &aacute;tomo.</span></p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;">Est&aacute; formado por&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Prot&oacute;n" href="https://es.wikipedia.org/wiki/Prot%C3%B3n">protones</a>&nbsp;y&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Neutr&oacute;n" href="https://es.wikipedia.org/wiki/Neutr%C3%B3n">neutrones</a>&nbsp;(denominados&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Nucle&oacute;n" href="https://es.wikipedia.org/wiki/Nucle%C3%B3n">nucleones</a>) que se mantienen unidos por medio de la&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Interacci&oacute;n nuclear fuerte" href="https://es.wikipedia.org/wiki/Interacci%C3%B3n_nuclear_fuerte">interacci&oacute;n nuclear fuerte</a>, la cual permite que el n&uacute;cleo sea estable, a pesar de que los protones se repelen entre s&iacute; (como los polos iguales de dos&nbsp;<a class="mw-redirect" style="text-decoration: none; color: #0b0080; background: none;" title="Im&aacute;n (f&iacute;sica)" href="https://es.wikipedia.org/wiki/Im%C3%A1n_(f%C3%ADsica)">imanes</a>). La cantidad de protones en el n&uacute;cleo (<a style="text-decoration: none; color: #0b0080; background: none;" title="N&uacute;mero at&oacute;mico" href="https://es.wikipedia.org/wiki/N%C3%BAmero_at%C3%B3mico">n&uacute;mero at&oacute;mico</a>), determina el&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Elemento qu&iacute;mico" href="https://es.wikipedia.org/wiki/Elemento_qu%C3%ADmico">elemento qu&iacute;mico</a>&nbsp;al que pertenece. Los n&uacute;cleos at&oacute;micos no necesariamente tienen el mismo n&uacute;mero de neutrones, ya que &aacute;tomos de un mismo elemento pueden tener&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Masa at&oacute;mica" href="https://es.wikipedia.org/wiki/Masa_at%C3%B3mica">masas</a>&nbsp;diferentes, es decir son&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Is&oacute;topo" href="https://es.wikipedia.org/wiki/Is%C3%B3topo">is&oacute;topos</a>&nbsp;del elemento.</p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;">La existencia del n&uacute;cleo at&oacute;mico fue deducida del&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Experimento de Rutherford" href="https://es.wikipedia.org/wiki/Experimento_de_Rutherford">experimento de Rutherford</a>, donde se bombarde&oacute; una l&aacute;mina fina de oro con&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Part&iacute;cula alfa" href="https://es.wikipedia.org/wiki/Part%C3%ADcula_alfa">part&iacute;culas alfa</a>, que son n&uacute;cleos at&oacute;micos de&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Helio" href="https://es.wikipedia.org/wiki/Helio">helio</a>&nbsp;emitidos por rocas radiactivas. La mayor&iacute;a de esas part&iacute;culas traspasaban la l&aacute;mina, pero algunas rebotaban, lo cual demostr&oacute; la existencia de un min&uacute;sculo n&uacute;cleo at&oacute;mico.</p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><strong>PROTON</strong></p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;">(del&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Idioma griego" href="https://es.wikipedia.org/wiki/Idioma_griego">griego</a>&nbsp;&pi;&rho;?&tau;&omicron;&nu;,&nbsp;<em>pr?ton</em>&nbsp;''primero'') <span style="text-decoration: underline;">es una&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="Part&iacute;cula subat&oacute;mica" href="https://es.wikipedia.org/wiki/Part%C3%ADcula_subat%C3%B3mica">part&iacute;cula subat&oacute;mica</a>&nbsp;con una&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="Carga el&eacute;ctrica" href="https://es.wikipedia.org/wiki/Carga_el%C3%A9ctrica">carga el&eacute;ctrica</a>&nbsp;elemental positiva</span> 1 (1,6 &times; 10<sup style="line-height: 1em;">-19</sup>&nbsp;<a class="mw-redirect" style="text-decoration: none; color: #0b0080; background: none;" title="Coulomb" href="https://es.wikipedia.org/wiki/Coulomb">C</a>), igual en&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Valor absoluto" href="https://es.wikipedia.org/wiki/Valor_absoluto">valor absoluto</a>&nbsp;y de signo contrario a la del electr&oacute;n, y una masa 1836 veces superior a la de un&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Electr&oacute;n" href="https://es.wikipedia.org/wiki/Electr%C3%B3n">electr&oacute;n</a>.</p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><span style="text-decoration: underline;">Experimentalmente, se observa el prot&oacute;n como estable, con un l&iacute;mite inferior en su&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="Vida media" href="https://es.wikipedia.org/wiki/Vida_media">vida media</a>&nbsp;de unos 10&nbsp;a&ntilde;os</span>, aunque&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Desintegraci&oacute;n del prot&oacute;n" href="https://es.wikipedia.org/wiki/Desintegraci%C3%B3n_del_prot%C3%B3n">algunas teor&iacute;as</a>&nbsp;predicen que el prot&oacute;n puede desintegrarse en otras part&iacute;culas.<sup id="cite_ref-2" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/Prot%C3%B3n#cite_note-2">2</a></sup>&nbsp;Originalmente se pens&oacute; que el prot&oacute;n era una&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Part&iacute;cula elemental" href="https://es.wikipedia.org/wiki/Part%C3%ADcula_elemental">part&iacute;cula elemental</a>&nbsp;pero desde la d&eacute;cada de 1970 existe una evidencia s&oacute;lida de que es una part&iacute;cula compuesta. Para la&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Cromodin&aacute;mica cu&aacute;ntica" href="https://es.wikipedia.org/wiki/Cromodin%C3%A1mica_cu%C3%A1ntica">cromodin&aacute;mica cu&aacute;ntica</a>&nbsp;el prot&oacute;n es una part&iacute;cula formada por la uni&oacute;n estable de tres&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Quark" href="https://es.wikipedia.org/wiki/Quark">quarks</a>.<sup id="cite_ref-Feynman_3-0" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/Prot%C3%B3n#cite_note-Feynman-3">3</a></sup></p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><strong>NEUTRON</strong></p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><span style="text-decoration: underline;">Es una part&iacute;cula subat&oacute;mica, un&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="Nucle&oacute;n" href="https://es.wikipedia.org/wiki/Nucle%C3%B3n">nucle&oacute;n</a>, sin carga neta, presente en el&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="N&uacute;cleo at&oacute;mico" href="https://es.wikipedia.org/wiki/N%C3%BAcleo_at%C3%B3mico">n&uacute;cleo at&oacute;mico</a>&nbsp;de pr&aacute;cticamente todos los&nbsp;<a style="text-decoration: underline; color: #0b0080; background: none;" title="&Aacute;tomo" href="https://es.wikipedia.org/wiki/%C3%81tomo">&aacute;tomos</a></span>, excepto el&nbsp;<a class="mw-redirect" style="text-decoration: none; color: #0b0080; background: none;" title="Protio" href="https://es.wikipedia.org/wiki/Protio">protio</a>. Aunque se dice que el neutr&oacute;n no tiene carga, en realidad est&aacute; compuesto por tres&nbsp;<a class="mw-redirect" style="text-decoration: none; color: #0b0080; background: none;" title="Part&iacute;cula fundamental" href="https://es.wikipedia.org/wiki/Part%C3%ADcula_fundamental">part&iacute;culas fundamentales</a>&nbsp;cargadas llamadas&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Quark" href="https://es.wikipedia.org/wiki/Quark">quarks</a>, cuyas cargas sumadas son cero. Por tanto, el neutr&oacute;n es un&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Bari&oacute;n" href="https://es.wikipedia.org/wiki/Bari%C3%B3n">bari&oacute;n</a>&nbsp;neutro compuesto por dos quarks de tipo&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Quark abajo" href="https://es.wikipedia.org/wiki/Quark_abajo"><em>abajo</em></a>, y un quark de tipo&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Quark arriba" href="https://es.wikipedia.org/wiki/Quark_arriba"><em>arriba</em></a>.</p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;">Fuera del n&uacute;cleo at&oacute;mico, los neutrones son inestables, teniendo una vida media de 15 minutos (885,7 &plusmn; 0,8 s);<sup id="cite_ref-RPP_2-0" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/Neutr%C3%B3n#cite_note-RPP-2">2</a></sup>&nbsp;cada&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Neutr&oacute;n libre" href="https://es.wikipedia.org/wiki/Neutr%C3%B3n_libre">neutr&oacute;n libre</a>&nbsp;se descompone en un&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Electr&oacute;n" href="https://es.wikipedia.org/wiki/Electr%C3%B3n">electr&oacute;n</a>, un&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Neutrino" href="https://es.wikipedia.org/wiki/Neutrino">antineutrino</a>&nbsp;y un&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Prot&oacute;n" href="https://es.wikipedia.org/wiki/Prot%C3%B3n">prot&oacute;n</a>. Su&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Masa" href="https://es.wikipedia.org/wiki/Masa">masa</a>&nbsp;es muy similar a la del prot&oacute;n, aunque ligeramente mayor.</p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;">&nbsp;</p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;">El neutr&oacute;n es necesario para la estabilidad de casi todos los n&uacute;cleos at&oacute;micos, a excepci&oacute;n del&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Is&oacute;topo" href="https://es.wikipedia.org/wiki/Is%C3%B3topo">is&oacute;topo</a>&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Hidr&oacute;geno-1" href="https://es.wikipedia.org/wiki/Hidr%C3%B3geno-1">hidr&oacute;geno-1</a>. La&nbsp;<a style="text-decoration: none; color: #0b0080; background: none;" title="Interacci&oacute;n nuclear fuerte" href="https://es.wikipedia.org/wiki/Interacci%C3%B3n_nuclear_fuerte">interacci&oacute;n nuclear fuerte</a>&nbsp;es responsable de mantenerlos estables en los n&uacute;cleos at&oacute;micos.</p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><strong style="color: #222222; font-family: arial, sans-serif; font-size: 16px;">Corteza at&oacute;mica</strong><span style="color: #222222; font-family: arial, sans-serif; font-size: 16px;">. </span></p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><span style="color: #222222; font-family: arial, sans-serif; font-size: 16px;"><span style="text-decoration: underline;">Se denomina as&iacute; a la parte externa de un &aacute;tomo que rodea al n&uacute;cleo y donde orbitan los electrones.</span> Posee un tama&ntilde;o unas 50.000 veces superior al del n&uacute;cleo pero sin embargo apenas posee masa.</span></p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;"><strong>ELECTRON</strong></p>\n<p style="margin: 0.5em 0px; line-height: inherit; color: #252525; font-family: sans-serif; font-size: 14px; text-align: justify;">(del&nbsp;<a class="mw-redirect" style="text-decoration: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Griego cl&aacute;sico" href="https://es.wikipedia.org/wiki/Griego_cl%C3%A1sico">griego cl&aacute;sico</a>&nbsp;?&lambda;&epsilon;&kappa;&tau;&rho;&omicron;&nu;&nbsp;<em>?lektron</em>&nbsp;''<a style="text-decoration: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="&Aacute;mbar" href="https://es.wikipedia.org/wiki/%C3%81mbar">&aacute;mbar</a>''), com&uacute;nmente representado por el s&iacute;mbolo:&nbsp;<strong>e<sup style="line-height: 1em;">&minus;</sup></strong>, es una&nbsp;<span style="text-decoration: underline;"><a style="text-decoration: underline; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Part&iacute;cula subat&oacute;mica" href="https://es.wikipedia.org/wiki/Part%C3%ADcula_subat%C3%B3mica">part&iacute;cula subat&oacute;mica</a>&nbsp;con una&nbsp;<a style="text-decoration: underline; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Carga el&eacute;ctrica" href="https://es.wikipedia.org/wiki/Carga_el%C3%A9ctrica#Carga_el.C3.A9ctrica_elemental">carga el&eacute;ctrica elemental</a>&nbsp;negativa.</span><sup id="cite_ref-14" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/Electr%C3%B3n#cite_note-14">12</a></sup>&nbsp;Un electr&oacute;n <span style="text-decoration: underline;">no tiene componentes o subestructura conocidos</span>, en otras palabras, generalmente se define como una&nbsp;<a style="text-decoration: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Part&iacute;cula elemental" href="https://es.wikipedia.org/wiki/Part%C3%ADcula_elemental">part&iacute;cula elemental</a>. <span style="text-decoration: underline;">En la&nbsp;<a style="text-decoration: underline; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Teor&iacute;a de cuerdas" href="https://es.wikipedia.org/wiki/Teor%C3%ADa_de_cuerdas">teor&iacute;a de cuerdas</a>&nbsp;se dice que un electr&oacute;n se encuentra formado por una subestructura (cuerdas).</span><sup id="cite_ref-prl50_2-1" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/Electr%C3%B3n#cite_note-prl50-2">2</a></sup>&nbsp;Tiene una masa que es aproximadamente 1836 veces menor con respecto a la del&nbsp;<a style="text-decoration: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Prot&oacute;n" href="https://es.wikipedia.org/wiki/Prot%C3%B3n">prot&oacute;n</a>.<sup id="cite_ref-nist_codata_mu_15-0" class="reference" style="line-height: 1em; unicode-bidi: isolate; white-space: nowrap;"><a style="text-decoration: none; color: #0b0080; background: none;" href="https://es.wikipedia.org/wiki/Electr%C3%B3n#cite_note-nist_codata_mu-15">13</a></sup>&nbsp;El&nbsp;<a style="text-decoration: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Momento angular" href="https://es.wikipedia.org/wiki/Momento_angular">momento angular</a>&nbsp;(esp&iacute;n) intr&iacute;nseco del electr&oacute;n es un valor semientero en unidades de&nbsp;<a style="text-decoration: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Constante de Planck" href="https://es.wikipedia.org/wiki/Constante_de_Planck"><em>?</em></a>, lo que significa que es un&nbsp;<a style="text-decoration: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Fermi&oacute;n" href="https://es.wikipedia.org/wiki/Fermi%C3%B3n">fermi&oacute;n</a>. Su&nbsp;<a style="text-decoration: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Antipart&iacute;cula" href="https://es.wikipedia.org/wiki/Antipart%C3%ADcula">antipart&iacute;cula</a>&nbsp;es denominada&nbsp;<a style="text-decoration: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Positr&oacute;n" href="https://es.wikipedia.org/wiki/Positr%C3%B3n">positr&oacute;n</a>: es id&eacute;ntica excepto por el hecho de que tiene cargas &mdash;entre ellas, la el&eacute;ctrica&mdash; de signo opuesto. Cuando un electr&oacute;n colisiona con un positr&oacute;n, las dos part&iacute;culas pueden resultar totalmente aniquiladas y producir&nbsp;<a style="text-decoration: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Fot&oacute;n" href="https://es.wikipedia.org/wiki/Fot%C3%B3n">fotones</a>&nbsp;de&nbsp;<a style="text-decoration: none; color: #0b0080; background-image: none; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;" title="Rayos gamma" href="https://es.wikipedia.org/wiki/Rayos_gamma">rayos gamma</a>.</p>', 24);
INSERT INTO `contenido` (`id`, `nombre`, `texto`, `usuario_id`) VALUES
(51, 'EL UNIVERSO', '<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: center; line-height: normal; mso-outline-level: 2;" align="center"><strong><span style="font-size: 10pt; font-family: Arial, sans-serif;">EL UNIVERSO</span></strong></p>\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal;"><strong><span style="font-size: 10pt; font-family: Arial, sans-serif;">PLANETA</span></strong></p>\n<p class="MsoListParagraph" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span style="font-size: 10pt; font-family: Symbol;">&middot;<span style="font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 10pt; font-family: Arial, sans-serif;">Seg&uacute;n la definici&oacute;n adoptada por la Uni&oacute;n Astron&oacute;mica Internacional, <u>un cuerpo celeste que Orbita alrededor de una estrella o remanente de ella.</u> Tiene suficiente masa para que su gravedad supere las fuerzas del cuerpo r&iacute;gido, de manera que asuma una forma en equilibrio hidrost&aacute;tico (pr&aacute;cticamente esf&eacute;rica). Ha limpiado la vecindad de su &oacute;rbita de planetesimales, o lo que es lo mismo tiene dominancia orbital. No emite una luz propia. Seg&uacute;n la definici&oacute;n, el sistema solar consta de ocho planetas: Mercurio, Venus, Tierra, Marte, J&uacute;piter, Saturno, Urano y Neptuno. En cambio Plut&oacute;n, que hasta 2006 se consideraba un planeta, ha pasado a clasificarse como planeta enano, junto a Ceres, tambi&eacute;n considerado planeta durante alg&uacute;n tiempo, ya que era un referente en la ley de Titius-Bode, y m&aacute;s recientemente considerado como asteroide, y ErV&iacute;a L&aacute;ctea es una galaxia espiral donde se encuentra el Sistema Solar y, por lo tanto, la Tierra. Seg&uacute;n las observaciones, posee una masa de 1012 masas solares y es una espiral barrada. Su di&aacute;metro medio se estima en unos 100 000 a&ntilde;os luz, equivalentes a casi un trill&oacute;n y medio (1.42E18) de km o 9480 millones de Unidades Astron&oacute;micas (UA). Se calcula que contiene entre 200 000 millones y 400 000 millones de estrellas. La distancia desde el Sol hasta el centro de la galaxia es de alrededor de 27.700 a&ntilde;os luz (8500 pc), es decir, el 55 % del radio total gal&aacute;ctico.</span></p>\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal;"><strong><span style="font-size: 10pt; font-family: Arial, sans-serif;">VIA LACTEA</span></strong></p>\n<p class="MsoListParagraph" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span style="font-size: 10pt; font-family: Symbol;">&middot;<span style="font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><u><span style="font-size: 10pt; font-family: Arial, sans-serif;">Forma parte de un conjunto de unas cuarenta galaxias llamado Grupo Local</span></u><span style="font-size: 10pt; font-family: Arial, sans-serif;">, y es la segunda m&aacute;s grande y brillante tras la Galaxia de Andr&oacute;meda (aunque puede ser la m&aacute;s masiva, como lo muestra un estudio reciente).2 El nombre V&iacute;a L&aacute;ctea proviene de la mitolog&iacute;a griega y en lat&iacute;n significa camino de leche. Esa es, en efecto, la apariencia de la tenue banda deatraviesais, un objeto transneptuniano similar a Plut&oacute;n. Ciertamente, desde los a&ntilde;os setenta exist&iacute;a un amplio debate sobre el concepto de planeta a la luz de los nuevos datos referentes al tama&ntilde;o de Plut&oacute;n (men luz que or de lo calculado en un principio), un debate que aument&oacute; en los a&ntilde;os siguientes al descubrirse nuevos objetos que pod&iacute;an tener tama&ntilde;os similares. De esta manera, esta nueva definici&oacute;n de planeta introduce el concepto de planeta enano, que incluye a Ceres, Plut&oacute;n, Haumea, Sedna, Makemake y Eris; y tiene la diferencia de definici&oacute;n en (3), ya que no ha despejado la zona local de su &oacute;rbita y no es un sat&eacute;lite de otro cuerpo. Prueba La galaxia de la V&iacute;a L&aacute;ctea o simplemente el firmamento terrestre, y as&iacute; lo afirma la mitolog&iacute;a griega, explicando que se trata de leche derramada del pecho de la diosa Hera (Juno para los romanos). Rubens representa la leyenda en su obra El nacimiento de la V&iacute;a L&aacute;ctea. Sin embargo, ya en la Antigua Grecia, el astr&oacute;nomo Dem&oacute;crito (460 a. C.-370 a. C.) sugiri&oacute; que aquel haz blanco en el cielo era en realidad un conglomerado de much&iacute;simas estrellas demasiado tenues individualmente como para ser reconocidas a simple vista. Su idea, no obstante, no halla respaldo hasta 1609 d. C. cuando el astr&oacute;nomo Italiano Galileo Galilei hace uso del telescopio y constata que Dem&oacute;crito estaba en lo cierto, ya que a donde quiera que mirase, aquel se encontraba lleno de estrellas. Las nebulosas son regiones del medio interestelar constituidas por gases (principalmente hidr&oacute;geno y helio) adem&aacute;s de elementos qu&iacute;micos en forma de polvo c&oacute;smico. Tienen una importancia cosmol&oacute;gica notable porque muchas de ellas son los lugares donde nacen las estrellas por fen&oacute;menos de condensaci&oacute;n y agregaci&oacute;n de la materia; en otras ocasiones se trata de los restos de estrellas ya extintas o en extinci&oacute;n.</span></p>\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal;"><strong><span style="font-size: 10pt; font-family: Arial, sans-serif;">UNIVERSO</span></strong></p>\n<p class="MsoListParagraph" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span style="font-size: 10pt; font-family: Symbol;">&middot;<span style="font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 10pt; font-family: Arial, sans-serif;">Es la totalidad del espacio y del tiempo, de todas las formas de la materia, la energ&iacute;a y el impulso, y las leyes y constantes f&iacute;sicas que las gobiernan. Sin embargo, el t&eacute;rmino tambi&eacute;n se utiliza en sentidos contextuales ligeramente diferentes y alude a conceptos como cosmos, mundo o naturaleza.1 Su estudio, en las mayores escalas, es el objeto de la cosmolog&iacute;a, disciplina basada en la astronom&iacute;a y la f&iacute;sica, en la cual se describen todos los aspectos de este universo con sus fen&oacute;menos. La ciencia modeliza el universo como un sistema cerrado que contiene energ&iacute;a y materia adscritas al espacio-tiempo y que se rige fundamentalmente por principios causales. Bas&aacute;ndose en observaciones del universo observable, los f&iacute;sicos intentan describir el continuo espacio-tiempo en que nos encontramos, junto con toda la materia y energ&iacute;a existentes en &eacute;l. Los experimentos sugieren que el universo se ha regido por las mismas leyes f&iacute;sicas, constantes a lo largo de su extensi&oacute;n e historia. Es homog&eacute;neo e isotr&oacute;pico. La fuerza dominante en distancias c&oacute;smicas es la gravedad, y la relatividad general es actualmente la teor&iacute;a m&aacute;s exacta para describirla. Las otras tres fuerzas fundamentales, y las part&iacute;culas en las que act&uacute;an, son descritas por el modelo est&aacute;ndar.</span></p>\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal;"><strong><span style="font-size: 10pt; font-family: Arial, sans-serif;">GALAXIA</span></strong></p>\n<p class="MsoListParagraph" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span style="font-size: 10pt; font-family: Symbol;">&middot;<span style="font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 10pt; font-family: Arial, sans-serif;">Es un conjunto de estrellas, nubes de gas, planetas, polvo c&oacute;smico, materia oscura y energ&iacute;a unidos gravitatoriamente. La palabra &laquo;galaxia&raquo; procede de los griegos, los cuales atribu&iacute;an el nacimiento de una galaxia a las gotas de leche derramadas en el universo por la diosa Helena mientras alimentaba a su hijo H&eacute;rcules.1 La cantidad de estrellas que forman una galaxia es incontable, desde las galaxias enanas, con 107, hasta las galaxias gigantes, con 1014 estrellas.[cita requerida] Formando parte de una galaxia existen subestructuras como las nebulosas, los c&uacute;mulos estelares y los sistemas estelares m&uacute;ltiples. Hist&oacute;ricamente, las galaxias se han clasificado de acuerdo a su forma aparente (morfolog&iacute;a visual, como se la suele nombrar). Una forma com&uacute;n es la de galaxia el&iacute;ptica que, como lo indica su nombre, tiene el perfil luminoso de una elipse. Las galaxias espirales tienen forma circular pero con estructura de brazos curvos envueltos en polvo. Galaxias inusuales se llaman galaxias irregulares y son, normalmente, el resultado de perturbaciones provocadas por la atracci&oacute;n gravitacional de galaxias vecinas. Estas interacciones entre galaxias vecinas, que pueden provocar la fusi&oacute;n de galaxias, pueden inducir el intenso nacimiento de estrellas. Finalmente, tenemos las galaxias peque&ntilde;as, que carecen de una estructura coherente y tambi&eacute;n se las llama galaxias irregulares.</span></p>\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; margin-left: 18.0pt; text-align: justify; line-height: normal;"><strong><span style="font-size: 10pt; font-family: Arial, sans-serif;">ESTRELLA </span></strong></p>\n<p class="MsoListParagraph" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; mso-add-space: auto; text-align: justify; text-indent: -18.0pt; line-height: normal; mso-list: l0 level1 lfo1;"><!-- [if !supportLists]--><span style="font-size: 10pt; font-family: Symbol;">&middot;<span style="font-variant-numeric: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: ''Times New Roman'';">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span><!--[endif]--><span style="font-size: 10pt; font-family: Arial, sans-serif;">(del lat&iacute;n stella) es una esfera luminosa de plasma que mantiene su forma gracias a un equilibrio hidrost&aacute;tico de fuerzas y a su propia gravedad. El equilibrio se produce esencialmente entre la fuerza de la gravedad, que empuja la materia hacia el centro de la estrella, y la presi&oacute;n que ejerce el plasma hacia fuera, que, tal como sucede en un gas, tiende a expandirlo. La presi&oacute;n hacia fuera depende de la temperatura, que en un caso t&iacute;pico como el del Sol se mantiene con la energ&iacute;a producida en el interior de la estrella. La estrella m&aacute;s cercana a la Tierra es el Sol. Otras estrellas son visibles a simple vista desde la Tierra durante la noche, apareciendo como una diversidad de puntos luminosos fijos en el cielo debido a su inmensa distancia de la Tierra. Hist&oacute;ricamente, las estrellas m&aacute;s prominentes fueron agrupadas en constelaciones y asterismos, y las estrellas m&aacute;s brillantes ganaron nombres propios. Un extensivo cat&aacute;logo ha sido compilado por los astr&oacute;nomos, proporcionando designaciones estandarizadas a las estrellas. Por lo que se refiere a la duraci&oacute;n de su vida, una estrella brilla debido a la fusi&oacute;n termonuclear del hidr&oacute;geno en helio en su n&uacute;cleo, liberando energ&iacute;a que atraviesa el interior de la estrella y despu&eacute;s se irradia hacia el espacio exterior. Cuando el hidr&oacute;geno en el n&uacute;cleo de una estrella est&aacute; casi agotado, casi todos los elementos m&aacute;s pesados que el helio producidos de forma natural son creados por nucleos&iacute;ntesis estelar durante la vida de la estrella y, en algunas estrellas, por nucleos&iacute;ntesis de supernovas cuando explotan. Al finalizar su vida, una estrella tambi&eacute;n puede contener materia degenerada. Los astr&oacute;nomos pueden determinar la masa, edad, metalicidad (composici&oacute;n qu&iacute;mica), y muchas otras propiedades de una estrella mediante la observaci&oacute;n de su movimiento a trav&eacute;s del espacio, su luminosidad y espectro, respectivamente. La masa total de una estrella es el principal determinante de su evoluci&oacute;n y destino final. Otras caracter&iacute;sticas de una estrella, incluyendo el di&aacute;metro y la temperatura, cambian a lo largo de su vida, mientras que el entorno de una estrella afecta a su rotaci&oacute;n y movimiento. Una gr&aacute;fica de dispersi&oacute;n de muchas estrellas que hace referencia a su luminosidad, magnitud absoluta, temperatura superficial y tipo espectral, conocido como el diagrama de Hertzsprung-Russell (Diagrama H-R), permite determinar la edad y el estado evolutivo de una estrella.</span></p>\n<p class="MsoNormal" style="mso-margin-top-alt: auto; mso-margin-bottom-alt: auto; text-align: justify; line-height: normal;"><span style="font-size: 10pt; font-family: Arial, sans-serif;">&nbsp;</span></p>\n<p>&nbsp;</p>\n<p class="MsoNormal" style="text-align: justify;"><span style="font-size: 10.0pt; mso-bidi-font-size: 12.0pt; line-height: 107%; font-family: ''Arial'',sans-serif;">&nbsp;</span></p>', 24);
INSERT INTO `definicion` (`id`, `detalle`, `concepto_id`) VALUES
(3, 'Una contraseña o clave es una forma de autentificación que utiliza información secreta para controlar el acceso hacia algún recurso.', 30),
(51, 'ámbito de la criptología el que se ocupa de las técnicas de cifrado o codificado destinadas a alterar las representaciones lingüística', 58),
(53, 'La investigación de operaciones se aplica a problemas que se refieren a la conducción y coordinación de operaciones (o actividades) dentro de una organización.', 61),
(54, 'Aplicación de métodos científicos en la mejora de la efectividad en las operaciones, decisiones y gestión o como la ciencia de aplicar los recursos disponibles para conseguir la satisfacción óptima de un objetivo específico deseado.', 59),
(55, 'La investigación de operaciones es la aplicación, por grupos interdisciplinarios, del método científico a problemas relacionados con el control de las organizaciones o sistemas, a fin de que se produzcan soluciones que mejor sirvan a los objetivos de la organización.', 63),
(56, 'descripción matemática (con frecuencia mediante una función o una ecuación), de un fenómeno del mundo real, como por ejemplo el tamaño de una población, la demanda por un producto, la rapidez de caída de un objeto, la concentración de un producto en una reacción química, la expectativa de vida de una persona cuando nace o el costo de la reducción de emisiones.', 64),
(57, 'la optimización, con sus múltiples áreas (Programación lineal, no lineal, entera, estocástica). La teoría de  decisiones y juegos, teoría de grafos o flujos de redes y simulación.', 66),
(60, 'Es la unidad constituyente más pequeña de la materia que tiene las propiedades de un elemento químico.', 68),
(61, 'Es la parte central de un átomo, tiene carga positiva, y concentra más del 99,9% de la masa total del átomo.', 69),
(62, 'Es una partícula subatómica con una carga eléctrica elemental positiva', 70),
(63, 'Es una partícula subatómica, un nucleón, sin carga neta, presente en el núcleo atómico de prácticamente todos los átomos', 71),
(65, 'Partícula subatómica con una carga eléctrica elemental negativa.', 73),
(66, 'Se denomina así a la parte externa de un átomo que rodea al núcleo y donde orbitan los electrones', 72),
(67, 'un cuerpo celeste que Orbita alrededor de una estrella o remanente de ella', 74);
